import React from 'react'
import { LoremIpsum, Avatar } from 'react-lorem-ipsum';
function Users()
{
    return(
        <div className='text-center container'>
          <h1 className="display-1 text-danger">Users</h1>
          <img className="w-40" src="https://images.pexels.com/photos/414102/pexels-photo-414102.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" />
          <LoremIpsum p={3} />
        </div>
    )

    
}
export default Users
